import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route, Routes} from 'react-router-dom';
import App from './App';
import AppManager from './AppManager';
import AppSupervisor from './AppSupervisor';
import * as serviceWorker from './serviceWorker';

ReactDOM.render(
    <Router>
    <Routes>
      <Route path = "/" element = {<App/>} />
      <Route path = "/agents" element = {<Agents/>}/>
      <Route path = "/agents/:id" element = {<Estadisticas/>} />
      <Route path = "/shared" element = {<Sharedvideos/>} />
      <Route path = "/videos" element = {<Videos/>} />
      <Route path = "/page" element = {<PaginaDinamica/>}>
        <Route path = "" element = {<PaginasHijas/>} />
        <Route path = ":pageSlug" element = {<Hija1/>} />
      </Route>
    </Routes>
  </Router>,
  document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
